(9, '<p style=\"margin: 0px 0px 1.5em; padding: 0px; border: 0px; font-size: 19px; vertical-align: baseline; background: #ffffff; outline: none 0px; text-rendering: optimizelegibility; font-family: \'PT Serif\', Arial, Helvetica, sans-serif;\">Молодым &ndash; дорогу! Свежесть, движение, смелость, напор, творчество, настойчивость, предприимчивость, жизнерадостность, обода самовыражения и активная жизненная позиция &ndash; все эти слова ассоциируются со словом &laquo;молодость&raquo; и с молодежной модой.</p>\r\n<p style=\"margin: 0px 0px 1.5em; padding: 0px; border: 0px; font-size: 19px; vertical-align: baseline; background: #ffffff; outline: none 0px; text-rendering: optimizelegibility; font-family: \'PT Serif\', Arial, Helvetica, sans-serif;\">Одним из представителей творческой активной молодежи был калифорниец Шон Стусси, который, как и положено жителю Калифорнии, увлеченно занимался сёрфингом. Кроме того, что Шон отлично стоял на сёрфе, он и неплохо делал доски для сёрфа, оставляя на них надпись в стиле граффити, содержащую его имя. Его работы привлекли внимание ребят из &laquo;Action Sports Retailer&raquo; и они предложили молодому парню принять участие в выставке в калифорнийском городке Лонг Бич.</p>\r\n<p style=\"margin: 0px 0px 1.5em; padding: 0px; border: 0px; font-size: 19px; vertical-align: baseline; background: #ffffff; outline: none 0px; text-rendering: optimizelegibility; font-family: \'PT Serif\', Arial, Helvetica, sans-serif;\"><a style=\"margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; background: transparent; outline: none 0px; text-rendering: optimizelegibility; color: #ff7c7d; transition: all 0.2s linear 0s;\" href=\"https://soberger.ru/wp-content/uploads/2016/01/%D0%A8%D0%BE%D0%BD-%D0%A1%D1%82%D1%83%D1%81%D1%81%D0%B8.jpg\" rel=\"attachment wp-att-2678\"><img class=\"size-full wp-image-2678 alignleft\" style=\"border: 0px; outline: none; max-width: 100%; height: auto; float: left; margin: 1.5em auto 3em; display: block;\" src=\"https://soberger.ru/wp-content/uploads/2016/01/%D0%A8%D0%BE%D0%BD-%D0%A1%D1%82%D1%83%D1%81%D1%81%D0%B8.jpg\" sizes=\"(max-width: 750px) 100vw, 750px\" srcset=\"https://soberger.ru/wp-content/uploads/2016/01/Шон-Стусси.jpg 750w, https://soberger.ru/wp-content/uploads/2016/01/Шон-Стусси-300x200.jpg 300w, https://soberger.ru/wp-content/uploads/2016/01/Шон-Стусси-150x100.jpg 150w, https://soberger.ru/wp-content/uploads/2016/01/Шон-Стусси-316x211.jpg 316w\" alt=\"Шон Стусси\" width=\"750\" height=\"500\" data-attachment-id=\"2678\" data-permalink=\"https://soberger.ru/stussy/%d1%88%d0%be%d0%bd-%d1%81%d1%82%d1%83%d1%81%d1%81%d0%b8/\" data-orig-file=\"https://soberger.ru/wp-content/uploads/2016/01/Шон-Стусси.jpg\" data-orig-size=\"750,500\" data-comments-opened=\"1\" data-image-meta=\"{&quot;aperture&quot;:&quot;0&quot;,&quot;credit&quot;:&quot;&quot;,&quot;camera&quot;:&quot;&quot;,&quot;caption&quot;:&quot;&quot;,&quot;created_timestamp&quot;:&quot;0&quot;,&quot;copyright&quot;:&quot;&quot;,&quot;focal_length&quot;:&quot;0&quot;,&quot;iso&quot;:&quot;0&quot;,&quot;shutter_speed&quot;:&quot;0&quot;,&quot;title&quot;:&quot;&quot;,&quot;orientation&quot;:&quot;1&quot;}\" data-image-title=\"Шон Стусси\" data-image-description=\"\" data-medium-file=\"https://soberger.ru/wp-content/uploads/2016/01/Шон-Стусси-300x200.jpg\" data-large-file=\"https://soberger.ru/wp-content/uploads/2016/01/Шон-Стусси.jpg\" /></a></p>\r\n<p style=\"margin: 0px 0px 1.5em; padding: 0px; border: 0px; font-size: 19px; vertical-align: baseline; background: #ffffff; outline: none 0px; text-rendering: optimizelegibility; font-family: \'PT Serif\', Arial, Helvetica, sans-serif;\">Опыта продаж у Шона не было, и они с приятелем решили привлечь внимание публики к своему стенду, надев черные футболки, на которых они нарисовали белый принт с надписью St&uuml;ssy. Родители Шона Стусси владели типографией и он получил там хорошие знания о возможностях работы с картинками. Кстати, надо отметить, что семья парня была довольно творчески развитой, что, по всей видимости, и передалось Шону по наследству.</p>\r\n<p style=\"margin: 0px 0px 1.5em; padding: 0px; border: 0px; font-size: 19px; vertical-align: baseline; background: #ffffff; outline: none 0px; text-rendering: optimizelegibility; font-family: \'PT Serif\', Arial, Helvetica, sans-serif;\"><a style=\"margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; background: transparent; outline: none 0px; text-rendering: optimizelegibility; color: #ff7c7d; transition: all 0.2s linear 0s;\" href=\"https://soberger.ru/wp-content/uploads/2016/01/%D1%84%D1%83%D1%82%D0%B1%D0%BE%D0%BB%D0%BA%D0%B0-white-Stussy.jpg\" rel=\"attachment wp-att-2680\"><img class=\"size-full wp-image-2680 alignleft\" style=\"border: 0px; outline: none; max-width: 100%; height: auto; float: left; margin: 1.5em auto 3em; display: block;\" src=\"https://soberger.ru/wp-content/uploads/2016/01/%D1%84%D1%83%D1%82%D0%B1%D0%BE%D0%BB%D0%BA%D0%B0-white-Stussy.jpg\" sizes=\"(max-width: 750px) 100vw, 750px\" srcset=\"https://soberger.ru/wp-content/uploads/2016/01/футболка-white-Stussy.jpg 750w, https://soberger.ru/wp-content/uploads/2016/01/футболка-white-Stussy-300x210.jpg 300w, https://soberger.ru/wp-content/uploads/2016/01/футболка-white-Stussy-150x105.jpg 150w, https://soberger.ru/wp-content/uploads/2016/01/футболка-white-Stussy-316x222.jpg 316w\" alt=\"футболка white Stussy\" width=\"750\" height=\"526\" data-attachment-id=\"2680\" data-permalink=\"https://soberger.ru/stussy/%d1%84%d1%83%d1%82%d0%b1%d0%be%d0%bb%d0%ba%d0%b0-white-stussy/\" data-orig-file=\"https://soberger.ru/wp-content/uploads/2016/01/футболка-white-Stussy.jpg\" data-orig-size=\"750,526\" data-comments-opened=\"1\" data-image-meta=\"{&quot;aperture&quot;:&quot;0&quot;,&quot;credit&quot;:&quot;&quot;,&quot;camera&quot;:&quot;&quot;,&quot;caption&quot;:&quot;&quot;,&quot;created_timestamp&quot;:&quot;0&quot;,&quot;copyright&quot;:&quot;&quot;,&quot;focal_length&quot;:&quot;0&quot;,&quot;iso&quot;:&quot;0&quot;,&quot;shutter_speed&quot;:&quot;0&quot;,&quot;title&quot;:&quot;&quot;,&quot;orientation&quot;:&quot;1&quot;}\" data-image-title=\"футболка white Stussy\" data-image-description=\"\" data-medium-file=\"https://soberger.ru/wp-content/uploads/2016/01/футболка-white-Stussy-300x210.jpg\" data-large-file=\"https://soberger.ru/wp-content/uploads/2016/01/футболка-white-Stussy.jpg\" /></a></p>\r\n<p style=\"margin: 0px 0px 1.5em; padding: 0px; border: 0px; font-size: 19px; vertical-align: baseline; background: #ffffff; outline: none 0px; text-rendering: optimizelegibility; font-family: \'PT Serif\', Arial, Helvetica, sans-serif;\">Доски продавались хорошо, но неожиданно горячий интерес стали вызывать и футболки с надписью в уникальном ручном стиле граффити, модным в те времена. Она разошлись с такой скоростью, что ошеломлённый Шон вдруг понял &ndash; это куда более легкий и быстрый способ заработать денег, чем кропотливая и сложная работа с досками для сёрфа.</p>\r\n<p style=\"margin: 0px 0px 1.5em; padding: 0px; border: 0px; font-size: 19px; vertical-align: baseline; background: #ffffff; outline: none 0px; text-rendering: optimizelegibility; font-family: \'PT Serif\', Arial, Helvetica, sans-serif;\">Спустя полгода, Шон вновь принимает участие в выставке, но кроме досок и футболок предлагает покупателям шорты и шапки. Предприимчивый парень шёл самым простым путем &ndash; приобретал в магазинах приглянувшиеся ему вещи, немного их видоизменял, где-то подрезав и что-то подшив, наносил на них своё лого и продавал на фестивалях, делая определенную накрутку. Узнав о своём деле племянника, тётя Шона предложила ему свою помощь в качестве швеи &ndash; тогда St&uuml;ssy приблизились к началу создания одежды собственного дизайна.</p>\r\n<p style=\"margin: 0px 0px 1.5em; padding: 0px; border: 0px; font-size: 19px; vertical-align: baseline; background: #ffffff; outline: none 0px; text-rendering: optimizelegibility; font-family: \'PT Serif\', Arial, Helvetica, sans-serif;\">Когда парень понял, что дело не прогорит, пришло решение юридически зарегистрировать свой бизнес и создать полноценный бренд. И в 1984 году Шон со своим другом Фрэнком Синатрой Джуниором, который был дипломированным бухгалтером, они запускают официальное производство и продажу одежды. Бренд создал новый взгляд на моду, соединив классический спортивный стиль и элементы высокой моды и придав расслабленной серферской одежде бунтарского духа панка.</p>\r\n<p style=\"margin: 0px 0px 1.5em; padding: 0px; border: 0px; font-size: 19px; vertical-align: baseline; background: #ffffff; outline: none 0px; text-rendering: optimizelegibility; font-family: \'PT Serif\', Arial, Helvetica, sans-serif;\">Основной аудиторией, на которую был направлен дизайн одежды и среди которой она пользовалась популярностью, были сёрферы, скейтбордисты, панки и другие представителей молодежных субкультур.</p>\r\n<p style=\"margin: 0px 0px 1.5em; padding: 0px; border: 0px; font-size: 19px; vertical-align: baseline; background: #ffffff; outline: none 0px; text-rendering: optimizelegibility; font-family: \'PT Serif\', Arial, Helvetica, sans-serif;\"><a style=\"margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; background: transparent; outline: none 0px; text-rendering: optimizelegibility; color: #ff7c7d; transition: all 0.2s linear 0s;\" href=\"https://soberger.ru/wp-content/uploads/2016/01/stussy-shop.jpg\" rel=\"attachment wp-att-2683\"><img class=\"size-full wp-image-2683 alignleft\" style=\"border: 0px; outline: none; max-width: 100%; height: auto; float: left; margin: 1.5em auto 3em; display: block;\" src=\"https://soberger.ru/wp-content/uploads/2016/01/stussy-shop.jpg\" sizes=\"(max-width: 750px) 100vw, 750px\" srcset=\"https://soberger.ru/wp-content/uploads/2016/01/stussy-shop.jpg 750w, https://soberger.ru/wp-content/uploads/2016/01/stussy-shop-300x191.jpg 300w, https://soberger.ru/wp-content/uploads/2016/01/stussy-shop-150x96.jpg 150w, https://soberger.ru/wp-content/uploads/2016/01/stussy-shop-316x201.jpg 316w\" alt=\"stussy shop\" width=\"750\" height=\"478\" data-attachment-id=\"2683\" data-permalink=\"https://soberger.ru/stussy/stussy-shop/\" data-orig-file=\"https://soberger.ru/wp-content/uploads/2016/01/stussy-shop.jpg\" data-orig-size=\"750,478\" data-comments-opened=\"1\" data-image-meta=\"{&quot;aperture&quot;:&quot;0&quot;,&quot;credit&quot;:&quot;&quot;,&quot;camera&quot;:&quot;&quot;,&quot;caption&quot;:&quot;&quot;,&quot;created_timestamp&quot;:&quot;0&quot;,&quot;copyright&quot;:&quot;&quot;,&quot;focal_length&quot;:&quot;0&quot;,&quot;iso&quot;:&quot;0&quot;,&quot;shutter_speed&quot;:&quot;0&quot;,&quot;title&quot;:&quot;&quot;,&quot;orientation&quot;:&quot;1&quot;}\" data-image-title=\"stussy shop\" data-image-description=\"\" data-medium-file=\"https://soberger.ru/wp-content/uploads/2016/01/stussy-shop-300x191.jpg\" data-large-file=\"https://soberger.ru/wp-content/uploads/2016/01/stussy-shop.jpg\" data-pagespeed-url-hash=\"47401846\" /></a></p>\r\n<p style=\"margin: 0px 0px 1.5em; padding: 0px; border: 0px; font-size: 19px; vertical-align: baseline; background: #ffffff; outline: none 0px; text-rendering: optimizelegibility; font-family: \'PT Serif\', Arial, Helvetica, sans-serif;\">В 1986 году ребята начинают выпускать бейсболки &laquo;Big Ol&rsquo; S&raquo;, которые имели большой успех. Считается, что &laquo;Stussy стали первым брендом, сделавшим бейсболки, ассоциирующиеся раньше только со спортом, настоящим популярным повседневным аксессуаром.</p>\r\n<p style=\"margin: 0px 0px 1.5em; padding: 0px; border: 0px; font-size: 19px; vertical-align: baseline; background: #ffffff; outline: none 0px; text-rendering: optimizelegibility; font-family: \'PT Serif\', Arial, Helvetica, sans-serif;\">Спустя 8 лет открывается первый полноценный магазин в Нью-Йорке и одеждой бренда заинтересовались представители шоу-бизнеса, особенно артисты хип-хоп и рэп культуры.</p>\r\n<p style=\"margin: 0px 0px 1.5em; padding: 0px; border: 0px; font-size: 19px; vertical-align: baseline; background: #ffffff; outline: none 0px; text-rendering: optimizelegibility; font-family: \'PT Serif\', Arial, Helvetica, sans-serif;\">Шон и Фрэнк, будучи сами продвинутыми ребятами, в создании рекламной компании делают ставку на сотрудничество с профессиональными фотографами и видеооператарами, а также с популярными известными личностями.&nbsp; Например, фотограф и сын христианских миссионеров Дэвид Добсон создал фотопроект, в котором он во время своих путешествий фотографировал людей по всему миру в одежде от &laquo;Stussy&raquo;.</p>\r\n<p style=\"margin: 0px 0px 1.5em; padding: 0px; border: 0px; font-size: 19px; vertical-align: baseline; background: #ffffff; outline: none 0px; text-rendering: optimizelegibility; font-family: \'PT Serif\', Arial, Helvetica, sans-serif;\">Летом 1988 года на популярно молодежном канале MTV выходит проект &mdash; передача &laquo;St&uuml;ssy x Yo!&raquo;, рассказывающий об истории рэпа в Америке. А осенью 1991 когда бренд попадает на страницы культового журнала &laquo;TIME&raquo;, где опубликовали огромную статью под названием &laquo;Where Surf Meets Rap&raquo;, рассказывающую о молодой марке и благодаря которой &laquo;St&uuml;ssy&raquo; стали ассоциироваться с миром хип-хопа, а не сёрфинга.</p>\r\n<p style=\"margin: 0px 0px 1.5em; padding: 0px; border: 0px; font-size: 19px; vertical-align: baseline; background: #ffffff; outline: none 0px; text-rendering: optimizelegibility; font-family: \'PT Serif\', Arial, Helvetica, sans-serif;\"><a style=\"margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; background: transparent; outline: none 0px; text-rendering: optimizelegibility; color: #ff7c7d; transition: all 0.2s linear 0s;\" href=\"https://soberger.ru/wp-content/uploads/2016/01/mtv.jpg\" rel=\"attachment wp-att-2685\"><img class=\"size-full wp-image-2685 alignleft\" style=\"border: 0px; outline: none; max-width: 100%; height: auto; float: left; margin: 1.5em auto 3em; display: block;\" src=\"https://soberger.ru/wp-content/uploads/2016/01/mtv.jpg\" sizes=\"(max-width: 750px) 100vw, 750px\" srcset=\"https://soberger.ru/wp-content/uploads/2016/01/mtv.jpg 750w, https://soberger.ru/wp-content/uploads/2016/01/mtv-300x185.jpg 300w, https://soberger.ru/wp-content/uploads/2016/01/mtv-150x92.jpg 150w, https://soberger.ru/wp-content/uploads/2016/01/mtv-316x195.jpg 316w\" alt=\"mtv\" width=\"750\" height=\"462\" data-attachment-id=\"2685\" data-permalink=\"https://soberger.ru/stussy/mtv/\" data-orig-file=\"https://soberger.ru/wp-content/uploads/2016/01/mtv.jpg\" data-orig-size=\"750,462\" data-comments-opened=\"1\" data-image-meta=\"{&quot;aperture&quot;:&quot;0&quot;,&quot;credit&quot;:&quot;&quot;,&quot;camera&quot;:&quot;&quot;,&quot;caption&quot;:&quot;&quot;,&quot;created_timestamp&quot;:&quot;0&quot;,&quot;copyright&quot;:&quot;&quot;,&quot;focal_length&quot;:&quot;0&quot;,&quot;iso&quot;:&quot;0&quot;,&quot;shutter_speed&quot;:&quot;0&quot;,&quot;title&quot;:&quot;&quot;,&quot;orientation&quot;:&quot;1&quot;}\" data-image-title=\"mtv\" data-image-description=\"\" data-medium-file=\"https://soberger.ru/wp-content/uploads/2016/01/mtv-300x185.jpg\" data-large-file=\"https://soberger.ru/wp-content/uploads/2016/01/mtv.jpg\" data-pagespeed-url-hash=\"439645031\" /></a></p>\r\n<p style=\"margin: 0px 0px 1.5em; padding: 0px; border: 0px; font-size: 19px; vertical-align: baseline; background: #ffffff; outline: none 0px; text-rendering: optimizelegibility; font-family: \'PT Serif\', Arial, Helvetica, sans-serif;\">Также Шон создает грамотный маркетинговый некоммерческий проект &ndash; &laquo;Stussy Tribe&raquo;. Это была некая международная &laquo;группа поддержки&raquo; бренда, состоящая из известных музыкантов, диджеев, и других творческих людей, занимающих важное место в молодежной субкультуре. Самая главная и интересная особенность проекта заключалась в том, что все участники группы были истинными поклонниками одежды марки, а некоторые и хорошими приятелями Шона, поэтому продвижение бренда в массы делалось совершенно бескорыстно.</p>\r\n<p><ins class=\"adsbygoogle\" style=\"margin: 0px; padding: 0px; border: 0px; font-size: 19px; vertical-align: baseline; background: #999999; outline: none 0px; text-rendering: optimizelegibility; text-decoration-line: none; font-family: \'PT Serif\', Arial, Helvetica, sans-serif; display: block; text-align: center; height: 0px;\" data-ad-layout=\"in-article\" data-ad-format=\"fluid\" data-ad-client=\"ca-pub-9841839339024875\" data-ad-slot=\"5351030613\" data-adsbygoogle-status=\"done\"><ins id=\"aswift_1_expand\" style=\"margin: 0px; padding: 0px; border: none; vertical-align: baseline; background: transparent; outline: none 0px; text-rendering: optimizelegibility; text-decoration-line: none; display: inline-table; height: 0px; position: relative; visibility: visible; width: 750px;\"><ins id=\"aswift_1_anchor\" style=\"margin: 0px; padding: 0px; border: none; vertical-align: baseline; background: transparent; outline: none 0px; text-rendering: optimizelegibility; text-decoration-line: none; display: block; height: 0px; position: relative; visibility: visible; width: 750px; overflow: hidden; opacity: 0;\"><iframe id=\"aswift_1\" style=\"margin: 0px; padding: 0px; border-width: 0px; border-style: initial; vertical-align: baseline; background: transparent; outline: none 0px; text-rendering: optimizelegibility; left: 0px; position: absolute; top: 0px; width: 750px; height: 188px;\" src=\"https://googleads.g.doubleclick.net/pagead/ads?client=ca-pub-9841839339024875&amp;output=html&amp;h=188&amp;slotname=5351030613&amp;adk=2664616166&amp;adf=2677980867&amp;w=750&amp;fwrn=4&amp;lmt=1591261232&amp;rafmt=11&amp;psa=0&amp;guci=2.2.0.0.2.2.0.0&amp;format=750x188&amp;url=https%3A%2F%2Fsoberger.ru%2Fstussy%2F&amp;flash=0&amp;wgl=1&amp;adsid=ChEI8Lfi9gUQisWo8cKS8IaZARJFAKyC3LttlMfAIoSawKGtiOLKTJE2r-z7I3Xix252sAyd-ojm8b4Ac5wx5uxAoQdU80ex6MiLaILncwELC0uXHTvenWGP&amp;dt=1591261194473&amp;bpp=8&amp;