one 0px; text-rendering: optimizelegibility; font-family: \'PT Serif\', Arial, Helvetica, sans-serif;\">Большую роль в популярности одежды &laquo;Stussy&raquo; сыграл её некий бунтарский и дерзкий дух: часто надписи и картинки были провокационного или пародийного содержания и ради интересного принта (например, известный графический принт Stussy № 4) Стусси был готов был идти на риск, ведь компании-жертвы не редко подавали на бренд в суд.</p>\r\n<p style=\"margin: 0px 0px 1.5em; padding: 0px; border: 0px; font-size: 19px; vertical-align: baseline; background: #ffffff; outline: none 0px; text-rendering: optimizelegibility; font-family: \'PT Serif\', Arial, Helvetica, sans-serif;\">В 90-х у компании начались проблемы: логотип бренда стали путать с эмблемой марки &laquo;Mossimo&raquo;, так как они были очень похожи, а также на рынке стали появляться конкуренты &ndash; другие молодежные хип-хоп-марки, которые смогли отнять у &laquo;Stussy&raquo; большую часть рынка.</p>\r\n<p style=\"margin: 0px 0px 1.5em; padding: 0px; border: 0px; font-size: 19px; vertical-align: baseline; background: #ffffff; outline: none 0px; text-rendering: optimizelegibility; font-family: \'PT Serif\', Arial, Helvetica, sans-serif;\">В этот непростой период, в 1996 году происходит неожиданное и значимое событие в судьбе бренда &ndash; её покидает идейный основатель Шон Стусси, продав контрольный пакет акций своему компаньону. Спустя несколько лет Шон создаёт новую компанию под названием &laquo;S/Double Shop&raquo;, специализирующуюся на выпуске футболок и бейсболок, а также на производстве досок для сёрфинга.</p>\r\n<p style=\"margin: 0px 0px 1.5em; padding: 0px; border: 0px; font-size: 19px; vertical-align: baseline; background: #ffffff; outline: none 0px; text-rendering: optimizelegibility; font-family: \'PT Serif\', Arial, Helvetica, sans-serif;\">А Френку Синатру Джуниору приходиться начинать всё заново. Чтобы справиться с кризисом, он собрал новую команду из опытных творческих людей, и пересмотрел подход к продажам, увеличив объем экспорта в Европейские страны и в Японию. Плюс Френк решил сделать ставку на создание коллекций в сотрудничестве с другими популярными брендами, а также на совместную разработку принтов с модными иллюстраторами, художниками и музыкантами.</p>\r\n<p style=\"margin: 0px 0px 1.5em; padding: 0px; border: 0px; font-size: 19px; vertical-align: baseline; background: #ffffff; outline: none 0px; text-rendering: optimizelegibility; font-family: \'PT Serif\', Arial, Helvetica, sans-serif;\">В ноябре 1991 года открывается большой магазин бренда в модном районе Сохо Манхэттена, став непосредственным хитом города. Затем был открыт магазин в Лос-Анджелесе и в Токио.</p>\r\n<p style=\"margin: 0px 0px 1.5em; padding: 0px; border: 0px; font-size: 19px; vertical-align: baseline; background: #ffffff; outline: none 0px; text-rendering: optimizelegibility; font-family: \'PT Serif\', Arial, Helvetica, sans-serif;\">А в 1992 году бренд, производящий ранее только мужскую одежду, выпускает ограниченную линию одежды для женщин &laquo;Stussy Sista&raquo;, состоящую из облегающих вещей в ретро-стиле 70-х годов.&nbsp; Идея создания женской одежды кажется команде &laquo;Stussy&raquo; удачной и осенью 1998 года был зарегистрирован товарный знак &laquo;Stussy Sista&raquo;. Кстати, создание полноценной женской коллекции большая редкость для это редкость для молодежных хип-хоп и скейтерских марок.</p>\r\n<p style=\"margin: 0px 0px 1.5em; padding: 0px; border: 0px; font-size: 19px; vertical-align: baseline; background: #ffffff; outline: none 0px; text-rendering: optimizelegibility; font-family: \'PT Serif\', Arial, Helvetica, sans-serif;\"><a style=\"margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; background: transparent; outline: none 0px; text-rendering: optimizelegibility; color: #ff7c7d; transition: all 0.2s linear 0s;\" href=\"https://soberger.ru/wp-content/uploads/2016/01/Stussy-women.jpg\" rel=\"attachment wp-att-2687\"><img class=\"size-full wp-image-2687 alignleft\" style=\"border: 0px; outline: none; max-width: 100%; height: auto; float: left; margin: 1.5em auto 3em; display: block;\" src=\"https://soberger.ru/wp-content/uploads/2016/01/Stussy-women.jpg\" sizes=\"(max-width: 750px) 100vw, 750px\" srcset=\"https://soberger.ru/wp-content/uploads/2016/01/Stussy-women.jpg 750w, https://soberger.ru/wp-content/uploads/2016/01/Stussy-women-300x200.jpg 300w, https://soberger.ru/wp-content/uploads/2016/01/Stussy-women-150x100.jpg 150w, https://soberger.ru/wp-content/uploads/2016/01/Stussy-women-316x211.jpg 316w\" alt=\"Stussy women\" width=\"750\" height=\"500\" data-attachment-id=\"2687\" data-permalink=\"https://soberger.ru/stussy/stussy-women/\" data-orig-file=\"https://soberger.ru/wp-content/uploads/2016/01/Stussy-women.jpg\" data-orig-size=\"750,500\" data-comments-opened=\"1\" data-image-meta=\"{&quot;aperture&quot;:&quot;0&quot;,&quot;credit&quot;:&quot;&quot;,&quot;camera&quot;:&quot;&quot;,&quot;caption&quot;:&quot;&quot;,&quot;created_timestamp&quot;:&quot;0&quot;,&quot;copyright&quot;:&quot;&quot;,&quot;focal_length&quot;:&quot;0&quot;,&quot;iso&quot;:&quot;0&quot;,&quot;shutter_speed&quot;:&quot;0&quot;,&quot;title&quot;:&quot;&quot;,&quot;orientation&quot;:&quot;1&quot;}\" data-image-title=\"Stussy women\" data-image-description=\"\" data-medium-file=\"https://soberger.ru/wp-content/uploads/2016/01/Stussy-women-300x200.jpg\" data-large-file=\"https://soberger.ru/wp-content/uploads/2016/01/Stussy-women.jpg\" data-pagespeed-url-hash=\"1308792808\" /></a></p>\r\n<p style=\"margin: 0px 0px 1.5em; padding: 0px; border: 0px; font-size: 19px; vertical-align: baseline; background: #ffffff; outline: none 0px; text-rendering: optimizelegibility; font-family: \'PT Serif\', Arial, Helvetica, sans-serif;\">А в 1997 году &laquo;St&uuml;ssy&raquo; совместно с японской компанией &laquo;Casio&raquo; создают коллекцию часов &laquo;DW-6900&raquo;, впервые в мире разместив на готовых изделиях логотипы обеих марок.</p>\r\n<p style=\"margin: 0px 0px 1.5em; padding: 0px; border: 0px; font-size: 19px; vertical-align: baseline; background: #ffffff; outline: none 0px; text-rendering: optimizelegibility; font-family: \'PT Serif\', Arial, Helvetica, sans-serif;\">В конце 90-х большую популярность приобретает скейт культура и &laquo;Stussy&raquo; выступают спонсорами своей команды скейтеров на крупных международных соревнованиях.</p>\r\n<p style=\"margin: 0px 0px 1.5em; padding: 0px; border: 0px; font-size: 19px; vertical-align: baseline; background: #ffffff; outline: none 0px; text-rendering: optimizelegibility; font-family: \'PT Serif\', Arial, Helvetica, sans-serif;\">После запуска женской линейки одежды бренд начинает задумываться об очередном расширении ассортимента продукции и останавливает свой выбор на обуви. В 2000-х свет увидел ограниченный выпуск кроссовок &laquo;Nike X Stussy Huaraches&raquo; и &laquo;Nike Dunk High&raquo; в сотрудничестве с &laquo;Nike&raquo;, которые имели колоссальный успех и продавались с немыслимой скоростью.</p>\r\n<p style=\"margin: 0px 0px 1.5em; padding: 0px; border: 0px; font-size: 19px; vertical-align: baseline; background: #ffffff; outline: none 0px; text-rendering: optimizelegibility; font-family: \'PT Serif\', Arial, Helvetica, sans-serif;\"><a style=\"margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; background: transparent; outline: none 0px; text-rendering: optimizelegibility; color: #ff7c7d; transition: all 0.2s linear 0s;\" href=\"https://soberger.ru/wp-content/uploads/2016/01/Nike-Dunk-High.jpg\" rel=\"attachment wp-att-2689\"><img class=\"size-full wp-image-2689 alignleft\" style=\"border: 0px; outline: none; max-width: 100%; height: auto; float: left; margin: 1.5em auto 3em; display: block;\" src=\"https://soberger.ru/wp-content/uploads/2016/01/Nike-Dunk-High.jpg\" sizes=\"(max-width: 750px) 100vw, 750px\" srcset=\"https://soberger.ru/wp-content/uploads/2016/01/Nike-Dunk-High.jpg 750w, https://soberger.ru/wp-content/uploads/2016/01/Nike-Dunk-High-300x200.jpg 300w, https://soberger.ru/wp-content/uploads/2016/01/Nike-Dunk-High-150x100.jpg 150w, https://soberger.ru/wp-content/uploads/2016/01/Nike-Dunk-High-316x211.jpg 316w\" alt=\"Nike Dunk High\" width=\"750\" height=\"500\" data-attachment-id=\"2689\" data-permalink=\"https://soberger.ru/stussy/nike-dunk-high/\" data-orig-file=\"https://soberger.ru/wp-content/uploads/2016/01/Nike-Dunk-High.jpg\" data-orig-size=\"750,500\" data-comments-opened=\"1\" data-image-meta=\"{&quot;aperture&quot;:&quot;0&quot;,&quot;credit&quot;:&quot;&quot;,&quot;camera&quot;:&quot;&quot;,&quot;caption&quot;:&quot;&quot;,&quot;created_timestamp&quot;:&quot;0&quot;,&quot;copyright&quot;:&quot;&quot;,&quot;focal_length&quot;:&quot;0&quot;,&quot;iso&quot;:&quot;0&quot;,&quot;shutter_speed&quot;:&quot;0&quot;,&quot;title&quot;:&quot;&quot;,&quot;orientation&quot;:&quot;1&quot;}\" data-image-title=\"Nike Dunk High\" data-image-description=\"\" data-medium-file=\"https://soberger.ru/wp-content/uploads/2016/01/Nike-Dunk-High-300x200.jpg\" data-large-file=\"https://soberger.ru/wp-content/uploads/2016/01/Nike-Dunk-High.jpg\" data-pagespeed-url-hash=\"341296863\" /></a></p>\r\n<p style=\"margin: 0px 0px 1.5em; padding: 0px; border: 0px; font-size: 19px; vertical-align: baseline; background: #ffffff; outline: none 0px; text-rendering: optimizelegibility; font-family: \'PT Serif\', Arial, Helvetica, sans-serif;\">В этот же период тали ходить активные слухи о продаже компании. Действительно, покупкой &laquo;Stussy&raquo; был крайне заинтересован создатель империи Diesel и других модных брендов &mdash; Ренцо Россо, но, не смотр на это, Фрэнк ему отказал, сохранив за &laquo;Stussy&raquo; репутацию частной неформальной фирмы, которая по сей день полностью контролируется семьей Синатры.</p>\r\n<p style=\"margin: 0px 0px 1.5em; padding: 0px; border: 0px; font-size: 19px; vertical-align: baseline; background: #ffffff; outline: none 0px; text-rendering: optimizelegibility; font-family: \'PT Serif\', Arial, Helvetica, sans-serif;\">Все последующее время бренд успешно сотрудничает с популярными компаниями и людьми в процессе создания коллекций, ведет активную социальную и маркетинговую деятельность, организует вечеринки и спонсирует различные соревнования.</p>\r\n<p style=\"margin: 0px 0px 1.5em; padding: 0px; border: 0px; font-size: 19px; vertical-align: baseline; background: #ffffff; outline: none 0px; text-rendering: optimizelegibility; font-family: \'PT Serif\', Arial, Helvetica, sans-serif;\">Перечислять и описывать все коллекции компании просто бесполезно &ndash; каждая из них уникальна, неповторима и оставила определённый след в уличной моде. Философия &laquo;Stussy&raquo; проста и прозрачна &mdash; на первом месте бренд, на втором &mdash; прибыль. Бренд сознательно не выпускает крупных коллекций и строго контролирует, где и как продаются вещи. &laquo;Stussy&raquo;, как любой современный молодой человек, не стоят на месте, они постоянно в движении, постоянно экспериментируют и создают что-то новое. Можно сказать, что компания олицетворяет молодость. Даже сотрудники фирмы &mdash; люди довольно молодые, то, безусловно, помогает им сохранять прочную связь с основной потребительской аудиторией.</p>\r\n<p>&nbsp;</p>', 'История бренда  STUSSY', '1591261290816_c1bc6173c185afa12029ad7222bed444.jpg', NULL, '2020-04-16 09:18:40', '2020-06-04 13:01:58');
