(68, 'Nike SB Shane O\'Neill', '<p><span style=\"font-family: CirceWebRegular, sans-serif; font-size: 15px; background-color: #ffffff;\">Первая про-модель супер-техничного Шейна О\'Нила. </span></p>\r\n<p><span style=\"font-family: CirceWebRegular, sans-serif; font-size: 15px; background-color: #ffffff;\">Уникальная система шнуровки позволяет шнуровать модель традиционным способом, так и пропускать шнурки через специальные прочные петли, тем самым давая шнуркам вторую жизнь после соприкосновения с гриптейпом.</span></p>\r\n<p><span style=\"font-family: CirceWebRegular, sans-serif; font-size: 15px; background-color: #ffffff;\"> Стелька из пеноматериала со вставкой Zoom Air в области пятки обеспечит мгновенную амортизацию, а увеличенная резиновая накладка на носке позаботится о дополнительной прочности в этой зоне максимального износа.&nbsp;</span></p>', 0, 1, 0, '34900.00', NULL, '0.80', '2020-06-03 10:22:13', '2020-03-21 07:38:01', '2020-06-03 10:22:13'),
(69, 'Nike SB Zoom Stefan Janoski RM', '<p style=\"box-sizing: inherit; background-repeat: no-repeat; margin-top: 0px; margin-bottom: 0px; line-height: 1.54; font-family: \'open sans\', sans-serif; font-size: 13px;\">Промодель про-скейтера Стефана Яноски, ставшая классикой. Главная особенность модели &mdash; подошва, изготовленная с применением технологии Zoom Air.</p>\r\n<p style=\"box-sizing: inherit; background-repeat: no-repeat; margin-top: 0px; margin-bottom: 0px; line-height: 1.54; font-family: \'open sans\', sans-serif; font-size: 13px;\">Выполнена из прочного хлопка. Подошва с технологией Zoom Air обеспечивает отличную амортизацию и комфорт, а износостойкий протектор гарантирует надежное сцепление с поверхностью. Nike Zoom Stefan Janoski отлично подойдут как для катания на скейтборде, так и для повседневного использования в теплое время года.</p>', 1, 0, 1, '34900.00', '26100', '0.90', '2020-05-28 14:30:11', '2020-03-21 08:14:37', '2020-05-28 14:30:11'),
