(71, 'Nike SB Team Classic', '<p><span style=\"color: #2d2d2d; font-family: futura-pt-n4, futura-pt, Tahoma, Geneva, Verdana, Arial, sans-serif; font-size: 16px; letter-spacing: 0.4px;\">Тимовые версии каждый год меняются, но единственное, что остается неизменным - это стиль и инновационные технологии.</span></p>\r\n<p><span style=\"color: #2d2d2d; font-family: futura-pt-n4, futura-pt, Tahoma, Geneva, Verdana, Arial, sans-serif; font-size: 16px; letter-spacing: 0.4px;\">Идеальны дл скейтбординга, кофмортны в обычной жизни. </span></p>', 0, 1, 0, '34900.00', NULL, '0.90', NULL, '2020-03-21 08:34:22', '2020-03-30 02:22:17'),
