(73, 'Nike SB Blazer Low GT', '<p><span style=\"font-family: CirceWebRegular, sans-serif; font-size: 15px; background-color: #ffffff;\">Nike SB Blazer Low GT - бессмертная классика. Адаптированная версия для скейтбординга. Надежная фиксация ноги и адаптивная амортизацию без утяжеления.</span></p>', 0, 1, 0, '34900.00', NULL, '0.90', '2020-05-28 17:30:48', '2020-03-21 08:44:25', '2020-05-28 17:30:48'),
