(75, 'Nike SB Zoom Stefan Janoski Slip RM', '<p style=\"box-sizing: inherit; background-repeat: no-repeat; margin-top: 0px; margin-bottom: 0px; line-height: 1.54; font-family: \'open sans\', sans-serif; font-size: 13px;\">Промодель Стефана Яноски, адаптация классической модели под слипоны. Без шнурков намного проще, скейтеры поймут. Главная особенность модели &mdash; подошва, изготовленная с применением технологии Zoom Air.</p>\r\n<p style=\"box-sizing: inherit; background-repeat: no-repeat; margin-top: 0px; margin-bottom: 0px; line-height: 1.54; font-family: \'open sans\', sans-serif; font-size: 13px;\">Модель выполнена из прочного хлопка. Подошва слипонов с технологией Zoom Air обеспечивает отличную амортизацию и комфорт, а износостойкий протектор гарантирует надежное сцепление с поверхностью. Nike Zoom Stefan Janoski &mdash; слипоны, которые отлично подойдут как для катания на скейтборде, так и для повседневного использования в теплое время года.</p>', 1, 0, 1, '34900.00', '26100', '0.90', '2020-05-24 15:55:13', '2020-03-21 08:51:31', '2020-05-24 15:55:13'),
(76, 'Nike SB Zoom Blazer Mid', '<p><strong>Nike SB Zoom Blazer Mid</strong>&nbsp;&ndash; классическая модель бренда Nike, адаптированная под нужды скейтера.</p>\r\n<p>Модель наделили технологией Zoom Air и гибкой резиновой подошвой для лучшего контроля над доской.</p>\r\n<p style=\"text-align: center; font-size: 14px; margin-top: 30px; opacity: 0.65; font-family: sans-serif;\" data-f-id=\"pbf\">Powered by <a title=\"Froala Editor\" href=\"https://www.froala.com/wysiwyg-editor?pb=1\">Froala Editor</a></p>', 0, 1, 0, '42900.00', NULL, '1.20', NULL, '2020-03-21 08:52:43', '2020-03-30 02:05:02'),
(77, 'Qwe', '<p>123</p>', 0, 0, 1, '6.00', '5', '1.00', '2020-05-12 10:31:34', '2020-03-21 12:32:20', '2020-05-12 10:31:34'),
(78, 'Independent Milton Martinez Silver Black Standard', '<p><span style=\"color: #212121; font-family: Montserrat, Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;\">Independent Truck is proud to release Milton Martinez\'s first signature truck. The Martinez pro truck features polished silver hanger with an Independent Truck Co pad print on the front and a Milton Martinez signature print on the back, matte black baseplate, white cushions, and black hardware</span></p>', 0, 1, 1, '25900.00', NULL, '0.40', NULL, '2020-03-22 08:32:51', '2020-06-09 18:55:24'),
(79, 'Independent Hollow Baker 4 Life Flat Black Silver Standard', '<p><span style=\"color: #212121; font-family: Montserrat, Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;\">The Baker 4 Life signature truck by Independent. The Baker 4 Life truck features a matte black hanger with hollow laser etching, custom Baker 4 Life pad print, silver baseplate, red cushions and silver hardware. Lightweight version of Stage XI with hollow axle and kingpin. 55mm tall. 7% lighter than Stage XI polished silver hanger</span></p>', 0, 1, 0, '25900.00', NULL, '0.40', '2020-06-09 13:39:10', '2020-03-22 08:39:39', '2020-06-09 13:39:10'),
(80, 'Independent Dual Cross Flat Black Standard', '<p><span style=\"color: #212121; font-family: Montserrat, Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;\">The Dual Cross team truck by Independent. The Dual Cross truck features a flat black hanger with a Dual Cross metallic pad print, a flat black baseplate with orange cushions and silver hardware.</span></p>', 0, 1, 1, '23900.00', NULL, '0.40', '2020-06-09 13:38:03', '2020-03-22 08:45:58', '2020-06-09 13:38:03'),
