(94, 'Independent Polished Standard', '<p><span style=\"color: #000000; font-family: CirceWebRegular, sans-serif; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;\">Настоящая классика от Independent Trucks - комплект из двух надежных и качественных подвесок, которые могут стать частью вашего нового комплекта. Стандартная высота, обилие размеров, бушинги средней жесткости (90А) - наверняка они прослужат Вам не один сезон подряд, идеально вписавшись в ваш стиль катания.</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"color: #000000; font-family: CirceWebRegular, sans-serif; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;\">Особенности:</span></p>\r\n<ul style=\"margin: 1.2em 0px; padding: 0px 0px 0px 25px; color: #000000; font-family: CirceWebRegular, sans-serif; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; text-decoration-style: initial; text-decoration-color: initial;\">\r\n<li>Подвески для скейтборда</li>\r\n<li>Традиционный алюминиевый хангер и база</li>\r\n<