(212, 'Ricta Wheels 52mm Chrome Core Silver Wide 101a', '<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-family: \'Arial\',sans-serif; mso-ansi-language: EN-US;\">Keep your setup spicy with the new Chrome Core team series by Ricta Wheels. Chrome Cores feature the Rapido urethane formula, proven to be Ricta\'s most balanced formula for maximum speed and smooth control. New Chrome Core are guaranteed to protect the wheel during impact resulting in a noticeably smoother roll away from gaps and ledges. </span><span style=\"font-family: \'Arial\',sans-serif;\">Save your knees. Ride Chrome Cores.</span></p>', 0, 0, 0, '15900.00', NULL, '0.30', '2020-06-06 12:10:58', '2020-04-10 19:47:44', '2020-06-06 12:10:58'),
(213, 'Ricta Wheels 53mm  Rapido   Wide 101a', '<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-family: \'Arial\',sans-serif; mso-ansi-language: EN-US;\">New Ricta Rapido colorways are here and ready to roll! Rapido is Ricta\'s most balanced formula for maximum speed and smooth control. Right out the package, Rapido offers longer slides when you want it and increased control every time you need it. Ricta Rapido guarantees a longer roll with fewer flat-spots.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-family: \'Arial\',sans-serif; mso-ansi-language: EN-US;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-family: \'Arial\',sans-serif; mso-ansi-language: EN-US;\">The wide shape is cut with a flatter inside edge for a more controlled lock and has a wider riding surface for increased control and double the resistance to flat-spots. Available in 52mm, 53mm, 54mm, and 56mm.</span></p>', 0, 0, 0, '15900.00', NULL, '0.30', NULL, '2020-04-10 19:50:02', '2020-04-11 10:45:19'),
(214, 'Ricta Wheels 53mm  Sparx Black   99a', '<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-family: \'Arial\',sans-serif; mso-ansi-language: EN-US;\">Sparx by Ricta Wheel Dynamics - Great Urethane for the best price out! Sparx are designed to perform excellently on any terrain in the streets or the park. These wheels come in a classic park style shape guaranteed to maintain speed and slide great without compromising performance or flat spotting. Available from 51mm - 55mm. Ricta Wheels, speed reinvented.</span></p>', 0, 0, 0, '11900.00', NULL, '0.30', '2020-05-12 10:29:12', '2020-04-10 19:51:55', '2020-05-12 10:29:12'),
