(223, 'Ricta Wheels 54mm Rapido Wide 101a', '<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-family: \'Arial\',sans-serif; mso-ansi-language: EN-US;\">New Ricta Rapido wheels are here and ready to roll! Rapido is Ricta\'s most balanced formula for maximum speed and smooth control. Right out the package, Rapido offers longer slides when you want it and increased control every time you need it. Ricta Rapido guarantees a longer roll with fewer flat-spots.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-family: \'Arial\',sans-serif; mso-ansi-language: EN-US;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-family: \'Arial\',sans-serif; mso-ansi-language: EN-US;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-family: \'Arial\',sans-serif; mso-ansi-language: EN-US;\">The wide shape is cut with a flatter inside edge for a more controlled lock and has a wider riding surface for increased control and double the resistance to flat-spots. Available in 52mm, 53mm, 54mm, and 56mm.</span></p>', 0, 0, 0, '15900.00', NULL, '0.30', NULL, '2020-04-10 20:14:33', '2020-04-11 10:44:14'),
(224, 'Ricta Wheels 54mm Whirlwinds Teal Purple Swirl 99a', '<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-family: \'Arial\',sans-serif; mso-ansi-language: EN-US;\">Peep this! New color-combos in the Whirlwinds family by Ricta Wheels just dropped! Whirlwinds feature a wider riding surface and shape for better control and slides on any surface. The flat edge of the wheel is proven to lock-in better on any grind. Whirlwinds are available in 52mm, 53mm, and 54mm and are 99a durometer.</span></p>', 0, 0, 0, '15900.00', NULL, '0.30', '2020-06-10 17:01:42', '2020-04-10 20:18:19', '2020-06-10 17:01:42'),
