(241, 'Bronson Speed Co, Bearing CASE=10 BOX/8  Bearing G2', '<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size: 10.5pt; line-height: 107%; font-family: \'Arial\',sans-serif; background: white; mso-ansi-language: EN-US;\">* Deep Groove Raceways</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size: 10.5pt; line-height: 107%; font-family: \'Arial\',sans-serif; background: white; mso-ansi-language: EN-US;\">* Straight Edge Frictionless Shields</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size: 10.5pt; line-height: 107%; font-family: \'Arial\',sans-serif; background: white; mso-ansi-language: EN-US;\">* High Speed Ceramic Oil</span></p>', 0, 0, 4, '10900.00', NULL, '0.20', NULL, '2020-04-11 14:03:03', '2020-06-03 15:58:20'),
(242, 'Bronson Speed Co, Bearing CASE=10 BOX/8  Bearing G3', '<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size: 10.5pt; line-height: 107%; font-family: \'Arial\',sans-serif; background: white; mso-ansi-language: EN-US;\">Next Generation Bearings, Designed for Today&rsquo;s Skateboarding G3&rsquo;s</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size: 10.5pt; line-height: 107%; font-family: \'Arial\',sans-serif; background: white; mso-ansi-language: EN-US;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size: 10.5pt; line-height: 107%; font-family: \'Arial\',sans-serif; background: white; mso-ansi-language: EN-US;\">&bull; Deep Groove Raceways- balls roll deep in raceway channels - reduces side impact damage &amp; breakage</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size: 10.5pt; line-height: 107%; font-family: \'Arial\',sans-serif; background: white; mso-ansi-language: EN-US;\">&bull; Straight Edge Frictionless Shields- pop off resistant - holds oil in, dirt and moisture out- easy to clean</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size: 10.5pt; line-height: 107%; font-family: \'Arial\',sans-serif; background: white; mso-ansi-language: EN-US;\">&bull; Micro Groove Raceway Surfaces- linear micro-groove surfaces improve bearing lubrication, speed and spin</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size: 10.5pt; line-height: 107%; font-family: \'Arial\',sans-serif; background: white; mso-ansi-language: EN-US;\">&bull; Max Impact Cage Design- non- distortion custom cage keeps the balls precision spaced &amp; oil circulating</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size: 10.5pt; line-height: 107%; font-family: \'Arial\',sans-serif; background: white; mso-ansi-language: EN-US;\">&bull; Balls Out Technology- eliminates shield and cage contact on impact for a go fast, stay fast bearing</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size: 10.5pt; line-height: 107%; font-family: \'Arial\',sans-serif; background: white; mso-ansi-language: EN-US;\">&bull; High Speed Ceramic Oil- nano-ceramic compounds for wear protection - moisture, rust, corrosion resistant</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size: 10.5pt; line-height: 107%; font-family: \'Arial\',sans-serif; background: white; mso-ansi-language: EN-US;\">&bull; Factory Fresh Quality- nitrogen filled shrink wrap, reduces metal &amp; oil oxidation until ready to be ridden</span></p>', 0, 0, 4, '11900.00', NULL, '0.20', NULL, '2020-04-11 14:04:49', '2020-06-04 12:07:32'),
(243, 'Bronson Speed Co, Bearing Raw', '<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size: 10.5pt; line-height: 107%; font-family: \'Arial\',sans-serif; background: white; mso-ansi-language: EN-US;\">Bronson Speed Co. RAW Next Generation Shieldless Bearings</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size: 10.5pt; line-height: 107%; font-family: \'Arial\',sans-serif; background: white; mso-ansi-language: EN-US;\">Next Generation Shieldless Bearings, Designed for Today&rsquo;s Skateboarding</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size: 10.5pt; line-height: 107%; font-family: \'Arial\',sans-serif; background: white; mso-ansi-language: EN-US;\">&ldquo;Free at Last!&rdquo; - Shield Free Design No more shields to get damaged or pop off &ndash; the first shield-less bearing designed for skateboarding No shield grooves in either race for no crud, dust and dirt build up - super fast sound and spin</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size: 10.5pt; line-height: 107%; font-family: \'Arial\',sans-serif; background: white; mso-ansi-language: EN-US;\">&ldquo;Fast, Slick &amp; Non-Stick&rdquo; - Tungsten Coated Races</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size: 10.5pt; line-height: 107%; font-family: \'Arial\',sans-serif; background: white; mso-ansi-language: EN-US;\">Micro-thin tungsten dry lubricant coating is fast, slick and non-stick to minimize dirt, dust and crud build up. Tungsten coating is an extremely slick, low drag, long life dry film lubricant with a very low coefficient of friction &ndash; Tungsten coating works well with or without liquid lubricants.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size: 10.5pt; line-height: 107%; font-family: \'Arial\',sans-serif; background: white; mso-ansi-language: EN-US;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size: 10.5pt; line-height: 107%; font-family: \'Arial\',sans-serif; background: white; mso-ansi-language: EN-US;\">&ldquo;The Sound Of Speed&rdquo; &ndash; Audible Speed Technology Fully open, high spin, and shield free RAW&rsquo;s are designed to enhance the sound of speed. Run your bearings with no shields? Minimal oil? Like a RAW sound? This bearing&rsquo;s for you!</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size: 10.5pt; line-height: 107%; font-family: \'Arial\',sans-serif; background: white; mso-ansi-language: EN-US;\">&ldquo;Maximum Impact&rdquo; - Cage Design Super strong, durable, non-distortion fiberglass filled pure nylon cage keep the balls precision spaced. High wear and tear resistance, increased performance in a low lubricant/increased dust and dirt environment.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size: 10.5pt; line-height: 107%; font-family: \'Arial\',sans-serif; background: white; mso-ansi-language: EN-US;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size: 10.5pt; line-height: 107%; font-family: \'Arial\',sans-serif; background: white; mso-ansi-language: EN-US;\">&ldquo;Rollin&rsquo; Deep&rdquo; - Deep Groove Raceways Balls sit and roll deeper in the raceway channels than weaker shallow groove designs. Dramatically reduces axial and angular side impact damage and breakage, surfaces stay smooth and fast.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size: 10.5pt; line-height: 107%; font-family: \'Arial\',sans-serif; background: white; mso-ansi-language: EN-US;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size: 10.5pt; line-height: 107%; font-family: \'Arial\',sans-serif; background: white; mso-ansi-language: EN-US;\">&ldquo;Shred Ready&rdquo; - Factory Fresh Quality 100% hand inspected twice and micro-polished &amp; ultrasonic solvent washed 3X prior to final packaging. Packaged in nitrogen filled packaging &ndash; reduces metal and oil oxidation until ready to be ridden.</span></p>', 0, 0, 0, '14900.00', NULL, '0.20', NULL, '2020-04-11 14:06:25', '2020-04-11 14:34:48'),
