(270, 'Nike SB BRUIN Blue', '<p><span style=\"font-family: CirceWebRegular, sans-serif; font-size: 15px; background-color: #ffffff;\">NIKE SB ZOOM BRUIN &ndash; стильные кеды, которые будут высоко оценены любым скейтбордистом или челоком, живущим активной жизнью. Прочные материалы обеспечат износостойкость, технологичная подошва с вулканизированной конструкцией создаст безупречное сцепление как с доской, так и с асфальтом; стелька с безупречной амортизацией не даст ногам устать, а специальная технология, при которой изделие расширяется и сжимается во всех направлениях, гарантирует равномерное давление на стопу при движении &ndash; что тоже влияет на комфорт.</span></p>', 0, 0, 0, '34900.00', NULL, '0.40', NULL, '2020-04-16 14:06:06', '2020-04-16 14:06:06'),
(271, 'Nike SB Stefan Janoski SLIP blue', '<p style=\"box-sizing: inherit; background-repeat: no-repeat; margin-top: 0px; margin-bottom: 0px; line-height: 1.54; font-family: \'open sans\', sans-serif; font-size: 13px;\">Промодель Стефана Яноски, адаптация классической модели под слипоны. Без шнурков намного проще, скейтеры поймут. Главная особенность модели &mdash; подошва, изготовленная с применением технологии Zoom Air.</p>\r\n<p style=\"box-sizing: inherit; background-repeat: no-repeat; margin-top: 0px; margin-bottom: 0px; line-height: 1.54; font-family: \'open sans\', sans-serif; font-size: 13px;\">Модель выполнена из прочного хлопка. Подошва слипонов с технологией Zoom Air обеспечивает отличную амортизацию и комфорт, а износостойкий протектор гарантирует надежное сцепление с поверхностью. Nike Zoom Stefan Janoski &mdash; слипоны, которые отлично подойдут как для катания на скейтборде, так и для повседневного использования в теплое время года.</p>', 1, 0, 1, '34900.00', '26100', '0.50', '2020-05-28 14:31:25', '2020-04-16 14:08:46', '2020-05-28 14:31:25');
