(287, 'Nike SB Orange Label Bruin High \'L. Baker\' Shoes', '<p><span style=\"background-color: #ffffff;\"><span style=\"font-family: CirceWebRegular, sans-serif;\"><span style=\"font-size: 15px;\">Высокие кеды Nike SB Orange Label Bruin High \'L. Baker\'&nbsp;выполнены из натуральной кожи в коллаборации с Лэйси Бэйкер (Лео Бэйкер). Классический силуэт Bruin гарантирует абсолютный контроль над доской,технология амортизации Zoom Air обеспечивает комфорт в движении, а оптимальная посадка благодаря эргономичной конструкции по контурам стопы.</span></span></span></p>', 0, 1, 0, '37900.00', NULL, '1.00', NULL, '2020-04-30 14:03:09', '2020-04-30 14:05:13'),
(288, 'Nike SB Orange Label Janoski Slip On Remastered \'L. Baker\' Shoes', '<p style=\"box-sizing: inherit; background-repeat: no-repeat; margin-top: 0px; margin-bottom: 0px; line-height: 1.54; font-family: \'open sans\', sans-serif; font-size: 13px;\">Промодель Стефана Яноски, создана в коллаборации с Лео Бэйкер (Лэйси Бейкер) &mdash; адаптация классической модели под слипоны. Без шнурков намного проще, скейтеры поймут. Главная особенность модели &mdash; подошва, изготовленная с применением технологии Zoom Air и фирменный цвет, созданный специально для Лео Бейкер (Лэйси Бэйкер)</p>\r\n<p style=\"box-sizing: inherit; background-repeat: no-repeat; margin-top: 0px; margin-bottom: 0px; line-height: 1.54; font-family: \'open sans\', sans-serif; font-size: 13px;\">Модель выполнена из кожи. Подошва слипонов с технологией Zoom Air обеспечивает отличную амортизацию и комфорт, а износостойкий протектор гарантирует надежное сцепление с поверхностью. Nike Zoom Stefan Janoski &mdash; слипоны, которые отлично подойдут как для катания на скейтборде, так и для повседневного использования в теплое время года.</p>', 0, 1, 0, '34900.00', NULL, '1.00', NULL, '2020-04-30 14:13:10', '2020-04-30 14:13:10'),
(289, 'Nike SB GTS Return Premium', '<p><span style=\"font-family: CirceWebRegular, sans-serif; font-size: 15px; background-color: #ffffff;\">Удобные кеды Nike SB GTS Return Premium в стильном цветовом решении готовы стать не только удобной обувью для катания, но и отличным вариантом для ежедневной обуви. Цепкий протектор, вулканизированная конструкция подошвы и особая конструкция делают эти кеды поистине удобной обувью для скейтбординга, а лаконичный силуэт и стильное сочетание материалов позволят сочетать их практически с любой одеждой.</span></p>', 0, 1, 1, '39900.00', NULL, '1.00', NULL, '2020-04-30 14:26:35', '2020-05-23 18:16:22'),
